// client/src/components/TaskList.js
import React from 'react';

const TaskList = () => {
  const tasks = [
    {
      id: 1,
      title: 'Complete UI Design',
      description: 'Finish the new design mockups for the dashboard.',
      dueDate: '2025-04-30',
      priority: 'High',
      status: 'In Progress',
    },
    {
      id: 2,
      title: 'Fix API Bugs',
      description: 'Resolve reported issues in the login and registration API.',
      dueDate: '2025-04-28',
      priority: 'Medium',
      status: 'Pending',
    },
    {
      id: 3,
      title: 'Deploy Backend',
      description: 'Deploy the Express server to production.',
      dueDate: '2025-05-01',
      priority: 'High',
      status: 'Not Started',
    },
  ];

  return (
    <div>
      <h2>üìù Task List</h2>
      <ul style={{ listStyleType: 'none', padding: 0 }}>
        {tasks.map((task) => (
          <li key={task.id} style={{ marginBottom: '20px', padding: '10px', border: '1px solid #ccc', borderRadius: '10px' }}>
            <h3>{task.title}</h3>
            <p><strong>Description:</strong> {task.description}</p>
            <p><strong>Due Date:</strong> {task.dueDate}</p>
            <p><strong>Priority:</strong> {task.priority}</p>
            <p><strong>Status:</strong> {task.status}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TaskList;
